import { Component } from 'react'
import { Link } from 'react-router-dom'

import SquareRed from '../../assets/square_red.jpg'

import './thumb.css'

class Thumb extends Component {
  render() {
    return (
      <div className="card">
        <img src="{SquareRed}" alt="" />
        <h2>{this.props.title}</h2>
      </div>
    )
  }
}

export default Thumb
